import React, { useState } from "react";
import { Button } from "reactstrap";
import RecordRTC from "recordrtc";
import MongoClient from "mongodb";
import mongoose from "mongoose";

const ScreenRecording = () => {
  const [recording, setRecording] = useState(false);
  const [user, setUser] = useState(null);

  const handleRecordWindow = async () => {
    const recorder = await RecordRTC.createRecorder();
    recorder.startRecording();
    setRecording(true);
  };

  const handleRecordWebcam = async () => {
    const recorder = await RecordRTC.createRecorder();
    recorder.startRecording("video");
    setRecording(true);
  };

  const handleRecordAudio = async () => {
    const recorder = await RecordRTC.createRecorder();
    recorder.startRecording("audio");
    setRecording(true);
  };

  const handleStopRecording = async () => {
    if (recording) {
      const recorder = RecordRTC.getRecorder();
      recorder.stopRecording();
      setRecording(false);
    }
  };

  const saveRecording = async () => {
    try {
      const recordingData = {
        url: recordedMediaBlobUrl,
        timestamp: currentTimeStamp,
      };
      const url = "http://localhost:8080/api/recording"; // Replace with your backend URL
      await axios.post(url, recordingData);
      console.log("Recording saved successfully");
    } catch (error) {
      setError("An error occurred while stopping recording.");
      console.error(error);
    }
  };

  return (
    <div>
      <h1>Recording Confirmation</h1>
      <p>
        Are you sure you want to start recording?
      </p>
      <Button onClick={handleRecordWindow}>Record Entire Window</Button>
      <Button onClick={handleRecordWebcam}>Record Webcam</Button>
      <Button onClick={handleRecordAudio}>Record Audio</Button>
      {recording && (
        <Button onClick={handleStopRecording}>Stop Recording</Button>
      )}
      {recording && (
        <Button onClick={() => saveRecording(recording)}>Save Recording</Button>
      )}
    </div>
  );
};

export default ScreenRecording;
